import React from 'react';
import { Route, Redirect, Navigate } from 'react-router-dom';

const PrivateRoute = ({ component: Component, isAuthenticated, ...rest }) => {
    return (
    <Route
        {...rest}
        render={(props) =>
        isAuthenticated ? (
            <Component {...props} />
        ) : (
            <Navigate to="/login" />
        )
        }
    />
  );
};

export default PrivateRoute;
